package org.lu.hypervisor;

import org.junit.jupiter.api.Test;
import org.lu.hypervisor.entity.Classroom;
import org.lu.hypervisor.entity.Course;
import org.lu.hypervisor.entity.Subject;
import org.lu.hypervisor.model.Photo;
import org.lu.hypervisor.service.AttendanceService;
import org.lu.hypervisor.service.ClassroomService;
import org.lu.hypervisor.service.CourseService;
import org.lu.hypervisor.service.SubjectService;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;

import java.io.IOException;
import java.time.DayOfWeek;
import java.time.Duration;
import java.time.LocalTime;


@SpringBootTest
class HypervisorApplicationTests {
	@Autowired
	AttendanceService attendanceService;
	@Autowired
	ClassroomService classroomService;
	@Autowired
	CourseService courseService;
	@Autowired
	SubjectService subjectService;

	@Test
	void contextLoads() throws IOException {
		Subject teacher = new Subject();
		teacher.setRole("teacher");
		teacher.setName("张老三");
		Photo photo = new Photo();
		photo.setPhotoBase64("");
		teacher = subjectService.newSubject(teacher, photo);
		Classroom classroom = new Classroom();
		classroom.setIdentifier("2203");
		classroom = classroomService.newClassroom(classroom);
		Course course = new Course();
		course.setClassroom(classroom);
		course.setDay(DayOfWeek.MONDAY);
		course.setDuration(Duration.ofHours(2L));
		course.setName("母猪产后护理");
		course.setTime(LocalTime.of(10, 0));
		course.setTeacher(teacher);
		courseService.newCourse(course);
	}
}
